import React from 'react'

const Header = (color,bgColor) => {
  return (
    <>
    <div className="container">
        <h2 style={{backgroundColor:bgColor}}>FEEDBACK UI</h2>
    </div>
    </>
  )
}

Header.defaultProps  = {
    color: 'pink',
    bgColor:'green'
}

export default Header;
